root.render(
  <React.StrictMode>
    <Auth0Provider
      domain="dev-tnir4j710wmjgr18.us.auth0.com"
      clientId="LpVoZqEi0A2z2dByyuNiW7JaVjZjiHDo"
      authorizationParams={{
        redirect_uri: window.location.origin,
